  \"2016-07-27T22:45:53.607872\",\n\t\"name\": \"narrative-report-fish-springs-national-wildlife-refuge-dugway-utah-january-december-1964\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments during the 1964 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, big game animals, furbearers, predators, rodents, raptors, fish,
  reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, vegetation
  control, and prescribed burning. Resource management is outlined; topics include
  fur harvesting. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
  of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License
